class Submission:
    def __init__(self, user_id, data):
        self.user_id = user_id
        self.data = data
        self.status = "Pending"

class SubmissionManager:
    def __init__(self):
        self.submissions = []

    def submit_data(self, user_id, data):
        submission = Submission(user_id, data)
        self.submissions.append(submission)
        return submission

    def get_submission(self, submission_id):
        if 0 <= submission_id < len(self.submissions):
            return self.submissions[submission_id]
        return None

class FileManager:
    def __init__(self):
        self.files = {}

    def upload_file(self, submission_id, file_path):
        self.files[submission_id] = file_path

    def download_file(self, submission_id):
        return self.files.get(submission_id, "File not found")

class ProjectReport:
    def __init__(self):
        self.agency_reports = {}

    def report_to_agencies(self, agency, status):
        self.agency_reports[agency] = status

    def get_report(self, agency):
        return self.agency_reports.get(agency, "No report available")

class UIEditor:
    def __init__(self):
        self.edit_round = 0

    def move_to_next_round(self):
        self.edit_round += 1
        return self.edit_round

class ValidationRules:
    def __init__(self):
        self.rules = {}

    def update_rule(self, field, rule):
        self.rules[field] = rule

    def validate(self, submission):
        for field, rule in self.rules.items():
            if field not in submission.data or not rule(submission.data[field]):
                return False
        return True

class Developer:
    def __init__(self, submission_manager, validation_rules):
        self.submission_manager = submission_manager
        self.validation_rules = validation_rules

    def manage_submission_requests(self):
        for submission in self.submission_manager.submissions:
            if not self.validation_rules.validate(submission):
                submission.status = "Rejected"
            else:
                submission.status = "Approved"

# Example usage
submission_manager = SubmissionManager()
file_manager = FileManager()
project_report = ProjectReport()
ui_editor = UIEditor()
validation_rules = ValidationRules()
developer = Developer(submission_manager, validation_rules)

# User submits data
submission = submission_manager.submit_data("user_1", {"name": "Project A", "description": "Description of Project A"})

# Developer updates validation rules
validation_rules.update_rule("name", lambda x: isinstance(x, str) and len(x) > 0)
validation_rules.update_rule("description", lambda x: isinstance(x, str) and len(x) > 0)

# Developer manages submissions
developer.manage_submission_requests()

# User uploads a file
file_manager.upload_file(0, "/path/to/file/document.pdf")

# User downloads a file
downloaded_file = file_manager.download_file(0)

# UI Designer reports to agencies
project_report.report_to_agencies("Agency 1", "In Progress")

# UI Designer moves to the next round of edits
next_edit_round = ui_editor.move_to_next_round()
